import axios from "axios"
import { useState } from "react";
import { getapi,header } from "../constant"

const getResource = async()=>{
  let resp=null;  

  resp = await fetch(getapi,header)
  .then(response => resp=response.json());

  console.log(resp)
  return resp;

}
export default getResource;
